create table VerbList
(
    ID              int auto_increment
        primary key,
    FirstPart       text null,
    SecondPart      text null,
    ThirdPart       text null,
    Supine          text null,
    Conjugation     text null,
    Deponency       text null,
    EnglishMeanings text null,
    Notes           text null,
    constraint VerbList_ID_uindex
        unique (ID)
);

